import React from "react";
import { FirstName } from "./App";
import { LastName } from "./App";

const ComC = () => {
    return (
        <>
            <FirstName.Consumer>
                {(fname) => {
                    return (
                        <LastName.Consumer>
                            {() => {
                                return (

                                    <h1>Hello World!{fname}</h1>
                                )
                            }}
                        </LastName.Consumer>
                    )
                }}</FirstName.Consumer>
            <p> Flare On Top</p>
        </>
    )
}

export default ComC;
